DECLARE @tab1	NVARCHAR(100) = '[Production  details]'
DECLARE @tab2	NVARCHAR(100) = '[Prod BOM details]'
DECLARE @count	INT = 0

IF (SELECT  MIN(cast(quantity AS DECIMAL(20,5))) FROM [dbo].['Production  details$']) <= 0	PRINT 'ERROR - Quantity less than zero was found . => '			+ @tab1

	SELECT	@count = COUNT(*)
	FROM 	[dbo].['Prod BOM details$']		bom INNER JOIN
			[dbo].['Production  details$']	hdr ON [Production order ID] = [order]
	WHERE hdr.Quantity <> bom.[Per series]

IF (@count > 0)																				PRINT 'ERROR (' + cast(@count as nvarchar) + ') - Quantity <> than [Per series] . => '				+ @tab2

IF(SELECT COUNT(*) FROM [dbo].['Prod BOM details$'] WHERE unit NOT IN ('4"RollFt','Bag','Bag100','Bag80','Box','Box10','Box100','Box12','Box144','Box2','Box3','Box36','Box5','Box50','Box6','Carton','Case','cm','ea','ft','g','gal','in','kg','l','lb','m','mg','MI','ml','mm','oz','Pack','Pack50','Pair','Pint','Roll','Spool','sq. in.','TP','yd','Box25','Box150','Box500','Box20')) > 0				
																							PRINT 'ERROR - Unit of measure not found. => '		+ @tab2

IF(SELECT COUNT(*) FROM [dbo].['Prod BOM details$'] WHERE [Item number]		like 'WIP%' and Reservation <> 'Manual') > 0
																							PRINT 'ERROR - Reservation is not Manual when WIP. => '			+ @tab2

IF(SELECT COUNT(*) FROM [dbo].['Prod BOM details$'] WHERE [Item number] not like 'WIP%' and Reservation <> 'Start') > 0
																							PRINT 'ERROR - Reservation is not Start when not WIP. => '		+ @tab2
																				
IF(SELECT COUNT(*) FROM [dbo].['Prod BOM details$'] WHERE [Item number]		like 'WIP%'	and [Flushing principle] <> 'Start') > 0
																							PRINT 'ERROR - Flushing is not Start when WIP. => '				+ @tab2

IF(SELECT COUNT(*) FROM [dbo].['Prod BOM details$'] WHERE [Item number]	not	like 'WIP%'	and [Flushing principle] <> 'Manual') > 0
																							PRINT 'ERROR - Flushing is not Manual when ot WIP. => '			+ @tab2
	SELECT 	@count = count(distinct [Item number])  
			--distinct [Item number]
	 FROM	['Prod BOM details$']
	WHERE	[Item number] IN (
								SELECT ItemNum FROM [dbo].[RollStockMaterial$]
								UNION
								SELECT ItemNum FROM [dbo].[Wires$]
							) --MUST_BE_MFG
		  AND Warehouse <> 'TJ-MFG'
IF (@count > 0)																				PRINT 'ERROR - Wrong TJ-MFG warehouse for ' + cast(@count as nvarchar(10)) +'(items) => ' + @tab2

SELECT @count = COUNT(1) FROM [dbo].['Production  details$'] WHERE Quantity <> [Report remainder]
IF (@count > 0)																				PRINT 'ERROR (' + cast(@count as nvarchar) + ') - Quantity <> than [Report remainder] . => '	+ @tab1

-- Check 
	SELECT	@count = COUNT(*)
	FROM 	[dbo].['Prod BOM details$']	 dtl		
	WHERE [order] NOT IN 
						  (
						     SELECT [Production order ID]
							 FROM [dbo].['Production  details$']	
						   )
IF (@count > 0)																				PRINT 'ERROR (' + cast(@count as nvarchar) + ') - Order found in BOM but not in HDR . => '	+ @tab1


	SELECT	*--@count = COUNT(*)
	FROM 	[dbo].['Production  details$']	 dtl		
	WHERE [Production order ID] NOT IN 
									  (
										 SELECT [order] 
										 FROM [dbo].['Prod BOM details$']	
									   )
IF (@count > 0)																				PRINT 'ERROR (' + cast(@count as nvarchar) + ') - Order found in HDR but not in BOM . => '	+ @tab1



