--------- TO RUN IN TARGET ENVIRONMENT ------------ Operation Validation.
------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------
	--(1) Get route + OP to validate.
	SELECT	 --A.[Production order ID],A.[Route number] 
	   distinct  RTRIM(isnull(A.[Route number], '********' + item)) + '-' + CAST(CAST(B.[Last Operation] AS INT) AS NVARCHAR(10)) RutaOP
	FROM	[dbo].['Production  details$']	A INNER JOIN 
			[dbo].['Last Operation$']		B on A.[Production order ID] = B.[Production order ID]
	WHERE [Last Operation] <> ''	

